import React from "react";
import {Routes, Route} from "react-router-dom";
import Dashboard from "./components/Dashboard"

const MainRoutes=()=>{
    return <div >
        <Routes>
            <Route path="/dashboard" element= {<Dashboard />} />
        </Routes>
    </div>;
}

export default InnerContent
